import React from 'react';

const AuctionAbout = () => {
    return (
        <div className="auction-about-container">
            <div className="auction-head">
                <div className="character-img">
                </div>
                <div className="character-info">
                </div>
            </div>
            <div className="auction-body">
                
            </div>
        </div>
    )
}

export default AuctionAbout;
